transferOwnership","outputs":[],"stateMutability":"nonpayable","type":"function"}],"devdoc":{"kind":"dev","methods":{"createDutchAuction((address,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256),(address,uint256,uint256,address,uint256),(bool,uint256,uint256,uint256),address,bool,bool,address)":{"params":{"_feeReceiver":".","_fundToken":".","_isPrivateMode":".","_liquidity":"add liquidaty terms","_refundType":"burn token balance or refund (0 refund and 1 burn)","_vesting":"claim funds terms","info":"."}},"owner()":{"details":"Returns the address of the current owner."},"renounceOwnership()":{"details":"Leaves the contract without owner. It will not be possible to call `onlyOwner` functions. Can only be called by the current owner. NOTE: Renouncing ownership will leave the contract without an owner, thereby disabling any functionality that is only available to the owner."},"transferOwnership(address)":{"details":"Transfers ownership of the contract to a new account (`newOwner`). Can only be called by the current owner."}},"version":1},"userdoc":{"kind":"user","methods":{"createDutchAuction((address,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256,uint256),(address,uint256,uint256,address,uint256),(bool,uint256,uint256,uint256),address,bool,bool,address)":{"notice":"initailze core params of auction"}},"version":1}},"settings":{"compilationTarget":{"@gempad/dutchauction/contracts/factory/GempadDutchAuctionFactory.sol":"GempadDutchAuctionFactory"},"evmVersion":"istanbul","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":1000},"remappings":[]},"sources":{"@gempad/dutchauction/contracts/AuctionWhitelist.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.14;

import '@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol';

abstract contract AuctionWhitelist is Initializable, OwnableUpgradeable {
    mapping(address => bool) internal _whitelist;

    event WhitelistUpdated(address[] account, address sender);

    /**
     * @notice  add users to whitelist
     * @param _participants  address of users
     */
    function addWhitelist(address[] memory _participants) external onlyOwner {
        uint256 length = _participants.length;
        for (uint256 i = 0; i < length; i++) {
            require(_participants[i] != address(0), 'Invalid address');
            require(!_whitelist[_participants[i]], 'Participant is already whitelisted');
            _whitelist[_participants[i]] = true;
        }
        emit WhitelistUpdated(_participants, msg.sender);
    }

    /**
     * @notice  remove usres from whitelist
     * @param _participants  address of users
     */
    function removeWhitelist(address[] memory _participants) external onlyOwner {
        uint256 length = _participants.length;
        for (uint256 i = 0; i < length; i++) {
            require(_participants[i] != address(0), 'Invalid address');
            require(_whitelist[_participants[i]], 'Participant is not whitelisted');
            _whitelist[_participants[i]] = false;
        }
        emit WhitelistUpdated(_participants, msg.sender);
    }

    /**
     * @return  bool return whitelist status of user
     */
    function isWhitelisted(address _address) public view returns (bool) {
        return _whitelist[_address];
    }
}
